import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import BlogList from './components/Blog/BlogList';
import BlogPost from './components/Blog/BlogPost';

const App: React.FC = () => {
  return (
    <Router>
      <Navigation />
      <Switch>
        <Route path="/" exact>
          <div>Home Page</div>
        </Route>
        <Route path="/about">
          <div>About Page</div>
        </Route>
        <Route path="/blog">
          <div>Blog Page</div>
        </Route>
      </Switch>
    </Router>
  );
};

export default App;
